sys_variable_value.value:
(function execute(inputs, outputs) {

let storyObj = {
    "short_description" : inputs.story.short_description,
    "description" : inputs.story.description,
    "acceptance_criteria" : cleanHTML(inputs.story.acceptance_criteria),
    //"classification" : inputs.story.classification.getDisplayValue()
}

function cleanHTML(str) {
let cleanStr = str.replace(/<\/?[^>]+(>|$)/g, ""); //Remove tags
cleanStr = cleanStr.replace(/&amp;/g, '&'); //Retain any ampersands that are just ampersands
cleanStr = cleanStr.replace(/&#(\d+);/g, function(match, dec) {
        return String.fromCharCode(dec); //Returns the special character from the decimal code representation and returns the entire decoded string.
    });
return GlideStringUtil.normalizeWhitespace(cleanStr);
}

outputs.variable = storyObj;

})(inputs, outputs);

